Vẽ các điểm, chúng ta thấy rằng kích thước của hình chữ nhật là $x $ và $ 4 $.  Diện tích của hình chữ nhật là $(\text{length})(\text{width})=4x$, vậy $4x=28$ và $x=\boxed{7}$. [tị nạn]
kích thước (5cm);
đồ thị nhập khẩu;
defaultpen (linewidth (0.7) + fontsize(12));
thực x = 7;
cặp A = (0,0), B = (0,4), C = (x,4), D = (x,0);
cặp[] dấu chấm = {A,B,C,D};
dấu chấm (dấu chấm);
rút ra (A--B--C--D--chu kỳ);
xaxis (-2,9,Mũi tên(4));
yaxis (-2,7,Mũi tên(4));
nhãn ("$A$", A, SW);
nhãn ("$B$", B, Tây Bắc);
nhãn ("$C$", C, NE);
nhãn ("$D$", D, SE);
nhãn ("$x$",(B+C)/2,N);
nhãn ("$ 4 $", (C + D) / 2, E); [/asy]

